import { faFacebookF } from "@fortawesome/free-brands-svg-icons";

function Footer () {
    return (
        <div className="bg-black-500">    
            <footer>
                <div className="">
                    {/* <hr className="border border-gray p-4" /> */}
                    <img src={Logo} alt="Logo" className="w-12 h-12 py-1 select-none"/>
                </div>
            </footer>
        </div>
    )
}

export default Footer
